😍 This might be my new favorite photo that Garrett has ever captured of our family. Somehow, the more you squint or close your eyes the clearer our silhouettes become.. The moment was magic! ✨ Garrett doesn’t consider himself a great or professional photographer, BUT most importantly, he has a way of capturing the moment! I’ll share on our Instagram stories the behind the scenes of this special photo..❤️💙💚
